import React, {useState} from "react";
import {Box, Button, TextField} from "@mui/material";

const App = () => {
    const [input,setInput] = useState('');
    const [todos,setTodos] = useState([])
    return (
        <Box>
            <TextField
            label = "New todos"
            varient = "outlined"
            value = {input}
            onChange={(e) => setInput(e.target.value)}
            />
            <Button
                variant="contained"
                onClick={() => setTodos = []}
                >Add
            </Button>
        </Box>
    );
}

export default App;
